.sapCaUiChart {
    position: relative;
    padding-top: 1rem;
}

/* show the border only when selected */
.sapCaUiChart  .v-datapoint-selected {
    stroke: @sapCaUiChartAxisStroke;
    stroke-width: 0.063rem;
}

.sapCaUiChart path.v-datapoint-selected,
