.sapUiCbDis.sapUiCbChk > label,
.sapUiCbDis.sapUiCbWarn.sapUiCbRo.sapUiCbChk > label,
.sapUiCbDis.sapUiCbErr.sapUiCbRo.sapUiCbChk > label {
