.sapUiRespGridMedia-Std-Tablet.sapUiFormResGridCont > div > .sapUiTv,
.sapUiRespGridMedia-Std-Desktop.sapUiFormResGridCont > div > .sapUiTv,
.sapUiRespGridMedia-Std-LargeDesktop.sapUiFormResGridCont > div > .sapUiTv {
	margin-top: 2px;
}
